import { ChangeEvent, FormEvent, Fragment, useState } from 'react';
import iFactura from '../../Interfaces/Interfaces';
import {Button, Container, FloatingLabel, Form} from 'react-bootstrap'
interface Props {
    addANewFactura: (factura: iFactura) => void;
}

type HandleInputChange = ChangeEvent<HTMLInputElement| HTMLTextAreaElement>;

const AltaFacturas = (prop:Props) => {
    const [factura, setFactura] = useState({
        IDComision: 0, 
    NombrePrestador: "", 
    CuitPrestador: "",  
    NroPrestador: "",  
    TipoFactura: "", 
    ImporteFacturado: 0, 
    NroFactura: ""
    });


    const handlerNewFactura = (e:FormEvent<HTMLFormElement>) => {
        e.preventDefault();
        prop.addANewFactura(factura);
    }

    const handleInputChange = ({

        target : { name, value },
    }:HandleInputChange) => {
        setFactura({
            ...factura,
            [name]: value,
        });
    }

    return (
      <Fragment>
        <form onSubmit={handlerNewFactura}>
          <Container>
            <FloatingLabel
              controlId="floatingInput"
              label="Id de comision"
              className="mb-3"
            >
              <Form.Control type="number" placeholder="id de la comision" />
            </FloatingLabel>
            <FloatingLabel
              controlId="floatingPassword"
              label="Nombre del prestador"
            >
              <Form.Control type="password" placeholder="Password" />
            </FloatingLabel>
          </Container>

          {/* viejo */}
          <label>IdComision</label>
          <input
            type="number"
            name="IDComision"
            onChange={handleInputChange}
            value={factura.IDComision}
          ></input>
          <label>NombrePrestador</label>
          <input
            type="text"
            name="NombrePrestador"
            onChange={handleInputChange}
            value={factura.NombrePrestador}
          ></input>
          <label>CuitPrestador</label>
          <input
            type="text"
            name="CuitPrestador"
            onChange={handleInputChange}
            value={factura.CuitPrestador}
          ></input>
          <label>NroPrestador</label>
          <input
            type="text"
            name="NroPrestador"
            onChange={handleInputChange}
            value={factura.NroPrestador}
          ></input>
          <label>TipoFactura</label>
          <input
            type="text"
            name="TipoFactura"
            onChange={handleInputChange}
            value={factura.TipoFactura}
          ></input>
          <label>ImporteFacturado</label>
          <input
            type="number"
            name="ImporteFacturado"
            onChange={handleInputChange}
            value={factura.ImporteFacturado}
          ></input>
          <label>NroFactura</label>
          <input
            type="text"
            name="NroFactura"
            onChange={handleInputChange}
            value={factura.NroFactura}
          ></input>
          <Button variant="primary" type="submit">
            Agregar
          </Button>
        </form>
      </Fragment>
    );

}


export default AltaFacturas;
